import React from "react";
import styles from "./Footer.module.css";

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <p>
        Copyright &copy; <b>2023</b> All rights reserved. Designed By Rahul Baviskar.
      </p>
    </footer>
  );
};

export default Footer;
